import React, { useState } from "react";
import '../assets/styles/CareerBento.scss';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faPlus, faMinus, faLocationArrow, faRocket, faCode } from '@fortawesome/free-solid-svg-icons';

const CareerBento = () => {
  const [expandedIndex, setExpandedIndex] = useState<number | null>(0);

  const history = [
    {
      org: "KLAW Industries",
      role: "Software Engineer Intern",
      date: "2024 — 2025",
      location: "Binghamton, NY",
      logo: "https://images.squarespace-cdn.com/content/v1/5cfee7779de45a000197fd31/1622649420794-QC687JBOL698CEBAZOTH/KLAW+Industries+Transparent.png",
      impact: "Reduced incident response time by 40% and built scalable video pipelines with sub-200ms latency.",
      tools: ["AWS IoT Core", "Timestream", "Kinesis", "Linux", "Python"],
      details: "Designed low-latency telemetry ingestion services for multi-sensor data in high-availability environments."
    },
    {
      org: "LTIMindtree",
      role: "Software Engineer",
      date: "2021 — 2023",
      location: "Mumbai, India",
      logo: "https://companieslogo.com/img/orig/LTIM.NS-dea59dc6.png?t=1720244492",
      impact: "Achieved 65% latency reduction in financial microservices and cut defects by 25%.",
      tools: ["Java", "Spring Batch", "Drools", "SQL", "Power BI"],
      details: "Optimized large-scale financial accounting services and migrated legacy PL/SQL logic into Drools rule engines."
    },
    {
      org: "Binghamton University",
      role: "MS in Computer Science",
      date: "2023 — 2025",
      location: "New York, USA",
      logo: "https://upload.wikimedia.org/wikipedia/en/6/67/State_University_of_New_York_at_Binghamton_Seal.png",
      impact: "Maintained a 3.9/4.0 GPA and served as a Graduate Assistant for the CS Department.",
      tools: ["Cloud Computing", "Data Science", "Design Patterns", "Network Security"],
      details: "Specialization in Systems and Data Science. Relevant coursework included large-scale distributed systems."
    }
  ];

  return (
    <section className="career-minimal-section" id="career">
      <div className="section-header">
        <h2>Experience & Education</h2>
        <div className="line-divider"></div>
      </div>

      <div className="career-list">
        {history.map((item, index) => (
          <div 
            key={index} 
            className={`career-row ${expandedIndex === index ? 'active' : ''}`}
            onClick={() => setExpandedIndex(expandedIndex === index ? null : index)}
          >
            <div className="row-main">
              <span className="row-index">0{index + 1}</span>
              <div className="row-title">
                <h3>{item.role}</h3>
                <p>{item.org}</p>
              </div>
              <span className="row-date">{item.date}</span>
              <div className="row-icon">
                <FontAwesomeIcon icon={expandedIndex === index ? faMinus : faPlus} />
              </div>
            </div>

            <div className="row-details">
              <div className="details-grid">
                {/* Impact Section */}
                <div className="detail-col">
                  <div className="col-label"><FontAwesomeIcon icon={faRocket} /> Impact</div>
                  <p className="impact-highlight">{item.impact}</p>
                </div>

                {/* Description Section */}
                <div className="detail-col">
                  <div className="col-label">Role Description</div>
                  <p className="description-text">{item.details}</p>
                </div>

                {/* Tools Section */}
                <div className="detail-col full-width">
                  <div className="col-label"><FontAwesomeIcon icon={faCode} /> Tech Stack</div>
                  <div className="tool-pills">
                    {item.tools.map(tool => <span key={tool} className="pill">{tool}</span>)}
                  </div>
                </div>

                <div className="location-footer">
                  <FontAwesomeIcon icon={faLocationArrow} /> {item.location}
                </div>
              </div>
            </div>
          </div>
        ))}
      </div>
    </section>
  );
};

export default CareerBento;
